import React, { useState } from "react";
import {
  Switch,
  Route,
  NavLink,
  Prompt,
  useParams,
  useRouteMatch
} from "react-router-dom";
import "./index.css";

function App({ bookFacade }) {
  return (
    <div>
      <Header />
      <hr />
      <div className="content">
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/jokes">

          </Route>
          <Route path="/scrape">
          </Route>
          <Route>
            <PageDoesntExist />
          </Route>
        </Switch>
      </div>
    </div>
  );
}

function Header() {
  return (
    <div>
      <ul className="header">
        <li>
          <NavLink exact activeClassName="active" to="/">
            Home
          </NavLink>
        </li>
        <li>
          <NavLink activeClassName="active" to="/jokes">
            <FetchJokes/>
          </NavLink>
        </li>
        <li>
          <NavLink activeClassName="active" to="/scrape">
            Scrape
          </NavLink>
        </li>
      </ul>
    </div>
  );
}

function FetchJokes() {
  fetch("http://localhost:8080/jokeFetcher/api/jokes")
  .then(res => res.json())
  .then(data => {
    const dataArray = data.map(data => 
      `<p>Joke 1: ${data.joke1} Reference: ${data.joke1reference} Joke 2: ${data.joke2}, Reference: ${data.joke2reference} </p>`)
  })


return(
  <>
  <p>{dataArray}</p>
  </>
)
}

export default App;
